import React from 'react';
import Todo from './components/Todo';
import { ConfigProvider } from 'antd';
import './App.css'

function App() {
  <ConfigProvider
      theme={{
        components: {
          Button: {
            colorPrimary: '#00b96b',
            algorithm: true, // Enable algorithm
          },
          Input: {
            colorPrimary: '#eb2f96',
            algorithm: true, // Enable algorithm
          }
        },
      }}
    ></ConfigProvider>
  return (
    <div className='App'>
      <Todo/>
    </div>
  );
}

export default App;
